window.bookSummaryJSON = "<p>When Martin's raiding guild join the latest virtual reality MMO, they discover a challenge like no other. Strata Online is a 100-floor mega-dungeon, filled with an ever-shifting ecosystem of monsters.</p> <p>Martin's team soon find themselves in a race against the worldâ€™s strongest guilds, all competing to be the first to reach the unbeatable game's lowest depths. With eternal fame and prizes on the line, Martin risks playing as a rarely chosen race: a Murovan rat-man, combined with the unusual exorcist class.</p> <p>But unlike other games, he will need as much courage as skill to progress. Because the deeper he goes, the darker Strata gets.</p>"; 
